      body: '\n                   \n\n\n\n\n\n\n\n\n\n\n  Interceptors\n  AuthTokenInterceptor\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/infrastructure/interceptors/auth-token.interceptor.ts\n        \n\n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Private\n                                    Readonly\n                                authStateService\n                            \n                            \n                                    Private\n                                    Readonly\n                                platformId\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                intercept\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor()\n                    \n                \n                        \n                            \n                                Defined in src/app/infrastructure/interceptors/auth-token.interceptor.ts:15\n                            \n                        \n\n            \n        \n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        intercept\n                        \n                    \n                \n            \n            \n                \nintercept(request: HttpRequest<>, next: HttpHandler)\n                \n            \n\n\n                    \n                        \n                            Defined in src/app/infrastructure/interceptors/auth-token.interceptor.ts:19\n                        \n                    \n\n\n            \n                \n\n                            \n                                Parameters :\n                                \n                                \n                                    \n                                        \n                                            Name\n                                                Type\n                                            Optional\n                                        \n                                    \n                                    \n                                        \n                                                request\n                                            \n                                                        HttpRequest<>\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                        \n                                        \n                                                next\n                                            \n                                                        HttpHandler\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                        \n                                    \n                                \n                            \n                        \n                            Returns :     Observable>\n\n                        \n                            \n                                \n                            \n                \n            \n        \n    \n\n            \n    \n    \n        Properties\n    \n    \n        \n            \n                \n                    \n                    \n                            Private\n                            Readonly\n                        authStateService\n                        \n                    \n                \n            \n                \n                    \n                        Default value : inject(AuthStateService)\n                    \n                \n                    \n                        \n                                Defined in src/app/infrastructure/interceptors/auth-token.interceptor.ts:15\n                        \n                    \n\n\n        \n    \n    \n        \n            \n                \n                    \n                    \n                            Private\n                            Readonly\n                        platformId\n                        \n                    \n                \n            \n                \n                    \n                        Default value : inject(PLATFORM_ID)\n                    \n                \n                    \n                        \n                                Defined in src/app/infrastructure/interceptors/auth-token.interceptor.ts:14\n                        \n                    \n\n\n        \n    \n\n\n    \n\n\n    \n        import { Injectable, inject, PLATFORM_ID } from "@angular/core";\nimport {\n  HttpRequest,\n  HttpHandler,\n  HttpEvent,\n  HttpInterceptor,\n} from "@angular/common/http";\nimport { Observable } from "rxjs";\nimport { isPlatformBrowser } from "@angular/common";\nimport { AuthStateService } from "@app/domain/services/auth-state.service";\n\n@Injectable()\nexport class AuthTokenInterceptor implements HttpInterceptor {\n  private readonly platformId = inject(PLATFORM_ID);\n  private readonly authStateService = inject(AuthStateService);\n\n  constructor() {}\n\n  intercept(\n    request: HttpRequest,\n    next: HttpHandler,\n  ): Observable> {\n    // Solo agregar token en el navegador (no durante SSR)\n    if (isPlatformBrowser(this.platformId)) {\n      const token = this.authStateService.token();\n\n      if (token) {\n        console.log(\n          " AuthTokenInterceptor - Agregando token a la peticin:",\n          {\n            url: request.url,\n            method: request.method,\n            token: token.substring(0, 20) + "...",\n          },\n        );\n\n        const authRequest = request.clone({\n          headers: request.headers.set("Authorization", `Bearer ${token}`),\n        });\n\n        return next.handle(authRequest);\n      } else {\n        console.log(" AuthTokenInterceptor - No hay token disponible para:", {\n          url: request.url,\n          method: request.method,\n        });\n      }\n    } else {\n      console.log(\n        " AuthTokenInterceptor - Ejecutndose en servidor (SSR), no se agrega token",\n      );\n    }\n\n    return next.handle(request);\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching ""\n        \n    \n    \n        No results matching ""\n    \n\n',
