    "interfaces/CurrentMusic.html": {
      url: "interfaces/CurrentMusic.html",
      title: "interface - CurrentMusic",
      body: '\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  CurrentMusic\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/components/musics-table-play/musics-table-play.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        \n                                            playlist\n                                        \n                                \n                                \n                                        \n                                            song\n                                        \n                                \n                                \n                                        \n                                            songs\n                                        \n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        playlist\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        playlist:     Playlist | null\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     Playlist | null\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        song\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        song:     Song | null\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     Song | null\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        songs\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        songs:     Song[]\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     Song[]\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { MatIconModule } from \'@angular/material/icon\';\nimport { ChangeDetectionStrategy, Component, Input } from "@angular/core";\n\ninterface Song {\n  id: number;\n  title: string;\n  artists: string[];\n  album: string;\n  albumId: number;\n  duration: string;\n  image: string;\n}\n\ninterface Playlist {\n  id: number;\n  albumId?: number;\n  name?: string;\n  description?: string;\n}\n\ninterface CurrentMusic {\n  song: Song | null;\n  playlist: Playlist | null;\n  songs: Song[];\n}\n\n@Component({\n  selector: "app-musics-table-play",\nimports: [MatIconModule],\n  templateUrl: "./musics-table-play.html",\n  changeDetection: ChangeDetectionStrategy.OnPush,\n})\nexport class MusicsTablePlay {\n  @Input() song!: Song;\n  @Input() isCurrentSong = false;\n\n  // Mock state para el reproductor\n  currentMusic: CurrentMusic = {\n    song: null,\n    playlist: null,\n    songs: [],\n  };\n  isPlaying = false;\n\n  isNewSongOfAnotherPlaylist(song: Song): boolean {\n    return this.currentMusic.playlist?.id !== song.albumId;\n  }\n\n  isCurrentSongRunning(song: Song): boolean {\n    return (\n      this.currentMusic.song?.id === song.id &&\n      this.currentMusic.playlist?.albumId === song.albumId &&\n      this.isPlaying\n    );\n  }\n\n  setNewCurrentMusic(song: Song): void {\n    // Mock: simular carga de nueva playlist\n    setTimeout(() => {\n      this.currentMusic = {\n        song: song,\n        playlist: {\n          id: song.albumId,\n          albumId: song.albumId,\n          name: `Album ${song.album}`,\n          description: `Playlist for ${song.album}`,\n        },\n        songs: [song],\n      };\n      this.isPlaying = true;\n    }, 100);\n  }\n\n  handleClick(song: Song): void {\n    if (this.isCurrentSongRunning(song)) {\n      this.isPlaying = false;\n      return;\n    }\n\n    if (this.isNewSongOfAnotherPlaylist(song)) {\n      this.setNewCurrentMusic(song);\n      return;\n    }\n\n    // La playlist es la misma, pero la cancin es diferente\n    if (this.currentMusic.song?.id !== song.id) {\n      this.currentMusic = {\n        ...this.currentMusic,\n        song: song,\n      };\n    }\n    this.isPlaying = true;\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching ""\n        \n    \n    \n        No results matching ""\n    \n\n',
    },
